contract DonorDirectory{
    mapping(uint=> Donor) public donor_list;
    
    uint public donor_count;
    uint public organ_count;
    string public location;
    Donor[] public donor_array;

    constructor(string memory place){
        location=place;
    } 

    function addDonor(string memory name, address payable store, uint age, uint contact_number, uint verification_number, string memory blood_group, string memory organ_type, bool status, bool death_contract, bool isMedicaallyVerified) public{
        donor_count++;
        organ_count++;
        Donor memory new_donor= Donor(donor_count, store, name, age, contact_number, verification_number, blood_group, Organ(organ_count, organ_type, 0, 0), status, death_contract, isMedicaallyVerified, false);
        donor_array.push(new_donor);
        donor_list[donor_count]=new_donor;
    }

    function updateMedicalRecords(uint id,bool isMedicaallyVerified) public{
        donor_list[id].isMedicaallyVerified=isMedicaallyVerified;
    }
    function updateDeathContract(uint id, bool death_contract) public{
        donor_list[id].death_contract=death_contract;
    }

    function isVerified(uint id, uint contact_number, uint verification_number) private view returns(bool){
        if(donor_list[id].age>=18 && contact_number==donor_list[id].contact_number && verification_number==donor_list[id].verification_number && ((donor_list[id].death_contract==true && donor_list[id].status==false) || (donor_list[id].status==true)) && donor_list[id].isMedicaallyVerified==true){

            return true;
        }
        return false;
    }

    function removeDonor(uint id) public{
        delete donor_list[id];
    }

    function getDonor(uint id) public view returns(Donor memory){
        return (donor_list[id]);
    }

    function getDonorId(uint id) public view returns(address){
        return donor_list[id].store;
    }

    function siteVerification(uint contact_number, uint verification_number) public returns(bool){
        for(uint i=0; i<donor_array.length; i++){
            if(isVerified(donor_array[i].id, contact_number, verification_number)){
                donor_array[i].Verified=true;
                return true;
            }
        }
        return false;
    }

    function getArray() public view returns(Donor[] memory){
        return donor_array;
    }
}

contract RecipientReg{
    mapping(uint=> Recipient) public recipient_list;

    uint public recipient_count;
    Recipient[] recipient_array;


    function addRecipient(string memory name, address store, uint age, string memory organTypeNeeded, uint contactInfo, uint verification_number, string memory blood_group, bool isMedicaallyVerified) public{
        recipient_count++;
        Recipient memory new_recipient=Recipient(recipient_count, store, name, age, organTypeNeeded, contactInfo, verification_number, blood_group, isMedicaallyVerified);
        recipient_list[recipient_count]=new_recipient;
        recipient_array.push(new_recipient);
    }

    function updateMedicalRecords(uint id, bool isMedicaallyVerified) public{
        recipient_list[id].isMedicaallyVerified=isMedicaallyVerified;
    }

    function removeRecipient(uint id) public{
        delete recipient_list[id];
    }
    function getRecipient(uint id) public view returns(Recipient memory){
        return recipient_list[id];
    }

    function getRecipientId(uint id) public view returns(address){
        return recipient_list[id].store;
    }

    function payEther(uint id) public view{
        recipient_list[id].store.balance-(1 ether);
    }

    function getArray() public view returns(Recipient[] memory){
        return recipient_array;
    }
}

contract MatchMaking
{
    Match[] public match_array;
    uint match_count;

    function searchAndMatch(Donor[] memory donor_array, Recipient memory recipient) public{
        uint donor_id;
        for(uint i=0; i<donor_array.length; i++){
            if(keccak256(abi.encodePacked(donor_array[i].organ_type.organ_type))==keccak256(abi.encodePacked(recipient.organTypeNeeded)) && keccak256(abi.encodePacked(recipient.blood_group))== keccak256(abi.encodePacked(donor_array[i].blood_group)) && donor_array[i].Verified){
                donor_id=i;
                break;
            }
        }

        if(donor_id!=0 && recipient.id!=0 && recipient.isMedicaallyVerified){
            donor_array[donor_id].organ_type.recipient_Id=recipient.id;
            match_count++;
            Match memory new_match=Match(match_count, donor_array[donor_id].organ_type, donor_array[donor_id].id, recipient.id, donor_array[donor_id].store, recipient.store);
            match_array.push(new_match);
        }
    }

    function getArray() public view returns(Match[] memory){
        return match_array;
    }
    function getRecipientAddress(uint id) public view returns(address){
        return match_array[id-1].recipient_address;
    }
    function getDonorAddress(uint id) public view returns(address payable){
        return match_array[id-1].donor_address;
    }
}
